export enum Token {
    red, yellow, none
}

export function TokenToColor(tok: Token) {
    switch (tok) {
        case Token.none:
            return '#fff'
        case Token.red:
            return '#ff5252'
        case Token.yellow:
            return '#ffea00'
    }
}

